	// xt - target displacement in meters
	// y0 - launch elevation in meters
	// yt - target elevation in meters
	// Base equations
	// y = v0 * math.sin(a) * T - (g*T*T)/2
	// x = v0 * math.cos(a) * T #Range = xt-x0 

	// X = xt - x0
	// Y = yt - y0
	// [1] T = X/(v0 * math.cos(a)) 
	// [2] Y = v0 * math.sin(a) * (X/(v0 * math.cos(a))) - (g*(X/(v0 * math.cos(a)))*(X/(v0 * math.cos(a))))/2 
	// [3] Remembering that: 1/cos^2(a) = 1 + tan^2(a) 
	// [4] Rearrange [2] as: g*(X**2)*(tan(a)**2) - 2*(v0**2)*X*tan(a) + 2*(v0**2)*Y + g*(X**2) = 0
	// [5] Solving this quadratic equation for  tan(a): a = atan((v0**2) + sqrt((v0**4) - g*(g*(X**2)+2*Y*(v0**2))))/(g*X)

	const float v0 = 250; // constant, CAN NOT BE CHANGED
	
