	float X = xt - x0;
	float Y = yt - y0;
	float a1 = atan(((v0*v0) + sqrt(pow(v0,4) - g*(g*(X*X)+2*Y*(v0*v0))))/(g*X));
	float a2 = atan(((v0*v0) - sqrt(pow(v0,4) - g*(g*(X*X)+2*Y*(v0*v0))))/(g*X));

