	float Vx = v0 * cos(TH);
	float Vy = v0 * sin(TH);
	float T = X/(v0 * cos(TH));
	// float T = (Vy + sqrt(Vy*Vy + 2*g*Y)) / g;
	float Y_max = Y + (Vy*Vy) / (2*g);

